script: |
  super -f text -I q4300.spq | sort > q4300.out

inputs:
  - name: q4300.spq
    data: |
      SELECT ALL - 26 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 * + - col2 - + 88 NOT IN ( + col1, col1 * + - col2 + + col0 * - + 99 + + CAST ( NULL AS INTEGER ), col0 + + col0 );
  - name: tab1

outputs:
  - name: q4300.out
    data: |
